  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The SPEAKS- student dataset contains
  individual level information from a sample of college students on GLS funded campuses.
  These data include student demographics, the students' exposure to suicide prevention
  on their campus, their attitudes about suicide and seeking help, their self-efficacy
  to perform suicide-prevention related behaviors, their knowledge of suicide myths,
  facts, and their campus resources, and their connectedness and help-seeking behaviors.</p>n\",\n\t\"license_title\":
